import React, { useEffect, useState } from 'react'
import './login.css'
import Paper from '@mui/material/Paper';
import { Button, TextField } from '@mui/material';
import { useForm } from 'react-hook-form';
import { useNavigate } from "react-router-dom";
import { useSearchParams } from "react-router-dom";

const LoginBackground = () => {
    useEffect(()=>{
        setSearchParams({
            userAccount : true
        })
        const navigate = useNavigate();
    },[])
    let [searchParams, setSearchParams] = useSearchParams();
    let showSignIn = searchParams.get('userAccount') === 'false'
  return (
    <div className="main-screen-register h-screen w-screen flex flex-row justify-evenly grid grid-cols-2">
        <div className='left-screen-register'>
        </div>
        <div className='right-screen-register flex justify-center  items-center'>
            <Paper sx={{
                textAlign:'center',
                padding:'30px',
                borderRadius:'40px',
                width: '500px',
            }} elevation={6}>
                <div className="flex justify-between">
                    <h3 className='welcome-heading'>
                        Welcome to <span className='highlight'>MultiCare Clinic</span>
                    </h3>
                    {showSignIn ||  <div className='flex flex-col'>
                        <span className='have-account'>
                            Have an Account?
                        </span>
                        <Button 
                        onClick={()=>{
                            navigate("/signin");
                            setSearchParams({userAccount : false})
                        }}
                        sx={{
                            fontWeight: 400,
                            fontSize: '13px',
                            lineHeight: '20px',
                            color: '#779341',
                        }} variant="text">Sign In</Button>
                    </div>}
                </div>
            </Paper>
        </div>
    </div>
  )
}

export default LoginBackground
